import React from "react";
import MapChart from "./MapChart";

import "./Map.css";

const MapPage = (props) => {
  const MapProps = {
    world: {
      scale: 170,
      center: [40, 40],
      rotate: [-10, 0, 0],
      translateExtent: [
        [-100, -50],
        [860, 600],
      ],
    },
  };

  return (
    <>
      <div className="map">
        <MapChart
          setCurrChosen={props.setCurrChosen}
          currChosen={props.currChosen}
          currMap={props.currMap}
          // currLocation={props.currLocation}
        />
      </div>
    </>
  );
};

export default MapPage;
